from gmpy2 import isqrt, iroot
from Crypto.Util.number import long_to_bytes


def fermat_factor(n: int):
    a = int(isqrt(n)) + 1
    b, is_square = iroot(a ** 2 - n, 2)
    while not is_square:
        a += 1
        b, is_square = iroot(a ** 2 - n, 2)
    b = int(b)
    return (a - b), (a + b)


